        #region "Member Variable(s)"
        int pvTourID = 0;
        TOURTYPE pvTourType;

        public TOURTYPE fldTourType
        {
            get
            {
                if (Request.QueryString["TourType"] != null && Request.QueryString["TourType"].ToString().Trim() != "")
                {
                    switch (Convert.ToInt32(Request.QueryString["TourType"]))
                    {
                        case 1:
                            pvTourType = TOURTYPE.FIXED_TOUR;
                            break;
                        case 2:
                            pvTourType = TOURTYPE.SPECIAL_TOUR;
                            break;
                        case 3:
                            pvTourType = TOURTYPE.INTERNATIONAL_TOUR;
                            break;
                        case 4:
                            pvTourType = TOURTYPE.GROUP_TOUR;
                            break;
                        case 5:
                            pvTourType = TOURTYPE.ADHOC_TOUR;
                            break;
                        default:
                            pvTourType = TOURTYPE.FIXED_TOUR;
                            break;
                    }
                }
                else
                {
                    pvTourType = TOURTYPE.FIXED_TOUR;
                }
                return pvTourType;
            }
        }
        #endregion
        #region "Property(s)"
        public int fldTourID
        {
            get
            {
                if (Request.QueryString["TourID"] != null && Request.QueryString["TourID"].ToString().Trim() != "")
                {
                    pvTourID = Convert.ToInt32(Request.QueryString["TourID"]);
                }
                return pvTourID;
            }
        }
